  return (

    <div className="header">
      <div className="logo"></div>
        <ul className="navigation">
          <li><Link to='/'>Dashboard</Link></li>
          <li><Link to='/addbook'>Add a book</Link></li>
        </ul>
    </div>
  )
}

export default Header
